import React from 'react';

const ToDoList = ()=>{
    return(
        <>
            <div className='bodydiv'>
                <div className='container'>
                    <h1>To Do List</h1>
                    <input type='text'/>
                    <button>+</button>
                </div>
                <ol>
                    <li></li>
                </ol>
            </div>
        </>
    );
}

export default ToDoList
